import { Col } from 'react-bootstrap';
const SideBar = () =>{
    return(
        <Col xs={6} sm={6} md={6} lg={3}>
            <ul>
                <li>Dashboard</li>
                <li></li>
            </ul>
        </Col>
    )
}

export default SideBar;
